import * as React from 'react';
import {
  Text,
  View,
  StyleSheet,
  SafeAreaView,
  Image,
  TouchableOpacity,
  FlatList,
  ScrollView,
} from 'react-native';
import Feather from 'react-native-vector-icons/Feather';

import MaterialCommunityIcons from 'react-native-vector-icons/MaterialCommunityIcons';

import colors from '../../assets/colors/colors';

export default Detail = ({route, navigation}) => {
  const {item} = route.params;
  const renderingredientsIteam = ({item}) => {
    return (
      <View style={styles.ingredientItem}>
        <Image source={item.image} style={styles.ingredientItImage} />
      </View>
    );
  };
  return (
    <View style={styles.container}>
      <ScrollView>
        <SafeAreaView>
          <View style={styles.headerWrap}>
            <TouchableOpacity onPress={() => navigation.goBack()}>
              <View style={styles.headerLeft}>
                <Feather name="chevron-left" size={12} color={colors.red} />
              </View>
            </TouchableOpacity>
            <View style={styles.headerRight}>
              <MaterialCommunityIcons
                name="star"
                size={12}
                color={colors.white}
              />
            </View>
          </View>
          <View style={styles.titleWrapp}>
            <Text style={styles.titlTitle}>{item.title}</Text>
            <Text style={styles.titlePrice}>{item.price}</Text>
          </View>
          {/* info */}
          <View style={styles.infoWrapp}>
            <View style={styles.infoLeftWrapp}>
              <View style={styles.infoItemWrapp}>
                <Text style={styles.infoItemTitle}>Size</Text>
                <Text style={styles.infoItemText}>
                  {item.sizeName} {item.sizeNumber}
                </Text>
              </View>

              <View style={styles.infoItemWrapp}>
                <Text style={styles.infoItemTitle}>Crust</Text>
                <Text style={styles.infoItemText}>{item.crust}</Text>
              </View>

              <View style={styles.infoItemWrapp}>
                <Text style={styles.infoItemTitle}>Delivey in</Text>
                <Text style={styles.infoItemText}>{item.deliveryTime}</Text>
              </View>
            </View>
            <View>
              <Image
                source={item.image}
                style={{
                  resizeMode: 'contain',
                  marginLeft: 50,
                  width: 200,
                  height: 200,
                }}
              />
            </View>
          </View>
          <View style={styles.ingredientWrap}>
            <Text style={styles.ingredienttitle}>Ingredients</Text>
            <View style={styles.ingredientListWrap}>
              <FlatList
                showsHorizontalScrollIndicator={false}
                data={item.ingredients}
                renderItem={renderingredientsIteam}
                keyExtractor={item => item.id}
                horizontal={true}
              />
            </View>
          </View>
          <TouchableOpacity
            onPress={() => {
              alert('Thank for Order');
            }}>
            <View style={styles.button}>
              <Text style={styles.buttonText}>Place an Order</Text>
            </View>
          </TouchableOpacity>
        </SafeAreaView>
      </ScrollView>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  headerWrap: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    paddingHorizontal: 20,
    paddingTop: 20,
  },
  headerLeft: {
    borderColor: colors.red,
    borderWidth: 2,
    padding: 12,
    borderRadius: 10,
  },
  headerRight: {
    borderColor: colors.yellow,
    borderWidth: 2,
    padding: 12,
    borderRadius: 10,
    backgroundColor: colors.yellow,
  },
  titleWrapp: {
    marginTop: 30,
    paddingHorizontal: 20,
  },
  titlTitle: {
    fontSize: 32,
    color: colors.black,
    fontWeight: 'bold',
    fontFamily: 'Baloo2-Extrabold',
    width: '50%',
  },
  titlePrice: {
    fontSize: 32,
    marginTop: 10,
    color: colors.dark_red,
  },
  infoWrapp: {
    marginTop: 30,
    alignItems: 'center',
    flexDirection: 'row',
    justifyContent: 'space-between',
  },
  infoLeftWrapp: {paddingLeft: 20},
  infoItemWrapp: {marginBottom: 20},
  infoItemTitle: {fontSize: 14, color: colors.black, fontWeight: 'bold'},
  infoItemText: {fontSize: 18},

  ingredientWrap: {marginTop: 40},
  ingredienttitle: {
    paddingHorizontal: 20,
    fontSize: 16,
    fontWeight: 'bold',
    color: colors.black,
  },
  ingredientListWrap: {paddingVertical: 20},
  ingredientItem: {
    backgroundColor: colors.white,
    alignItems: 'center',
    justifyContent: 'center',
    paddingTop: 10,
    paddingRight: 15,
    flexDirection: 'row',
    borderRadius: 15,
    overflow: 'hidden',
    shadowColor: 'black',
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.05,
    shadowRadius: 10,
    elevation: 2,
  },
  ingredientItImage: {
    resizeMode: 'contain',
    width: 80,
    height: 80,
  },
  button: {
    marginTop: 20,
    paddingVertical: 25,
    paddingHorizontal: 20,
    backgroundColor: colors.yellow,
    borderRadius: 50,
    margin: 20,
    alignItems: 'center',
  },
});
